  "page1_article4_nl": "title: Wanneer je ineens een foutmelding krijgt!\nexcerpt: De oplossing? Heel eenvoudig.\ncategory: General\ndate: 2025-08-19\n\n[IMAGE:04_image_1.png]\nã…¤\n## Oplossing voor de fout â€œQuota overschredenâ€\nã…¤\nKreeg je tijdens het gebruik van de API plots de foutmelding [[purple:\"Quota overschreden\"]]?\nGeen paniek.\nDit komt heel vaak voor en er is een perfecte oplossing.\nã…¤\n## Huidige situatie inschatten\nJe API-sleutel staat momenteel 24 uur in de wacht. Maar je hoeft niet alleen te wachten! â€¨â€¨\nã…¤\n[IMAGE:04_image_2.png]\n\n## Oplossing 1.\nã…¤\nDit is de simpelste en meest effectieve methode.\nGoogle heeft weinig beperkingen voor registraties.\nDaarom kun je [[purple:meerdere Google-accounts aanmaken en voor elk een API-sleutel]] aanvragen.\nã…¤\n## Praktische toepassing.\n1. [[purple:Vraag vooraf API-sleutels aan met 3â€“5 Google-accounts]] en houd ze klaar\n2. [[purple:Schakel over naar de tweede sleutel]] zodra de eerste de limiet bereikt\n3. Gebruik ze afwisselend in een rotatiesysteem\nã…¤\n## Zorg eerst voor zoveel mogelijk APIâ€™s.\nã…¤\nAPI-sleutel 1 (main.account@gmail.com) - ABCDEFG...\nAPI-sleutel 2 (backup.account@gmail.com) - ABCDEFG...\nAPI-sleutel 3 (extra.account@gmail.com) - ABCDEFG...\nSla de sleutels zo op en roteer ze.\n\n[IMAGE:04_image_3.png]\n\nZo kun je het onbeperkt gebruiken.\nNoteer ze, zoals in de onderstaande afbeelding, in een notitie en roteer ze.\nHoe meer APIâ€™s, hoe beter.\n\n[IMAGE:04_image_4.png]\nã…¤\n---\nã…¤\n## Oplossing 2.\n\nHet bijsturen van je API-quotagebruik is ook een belangrijke strategie.\nDoor het zoekbereik te verkleinen, bespaar je flink quota.\n\n[IMAGE:04_image_5.png]\nã…¤\n[[purple:InefficiÃ«nte aanpak (vermijden)]]\n- Zoeken over alle landen\n- Een onnodig groot bereik instellen\n- In Ã©Ã©n keer te veel gegevens opvragen\nã…¤\n[[purple:EfficiÃ«nte aanpak (aanbevolen)]]\n- Alleen de benodigde landen selecteren (alleen doellanden zoals Korea, VS, Japan)\n- Regionaal sequentieel zoeken\n- Alleen echt benodigde data opvragen\nã…¤\n",
