  "page1_article6_de": "title: Eine Chance, dir die ViralitÃ¤t der KonkurrenzkanÃ¤le zu sichern!\nexcerpt: Nutze sofort â€FavoritenkanÃ¤leâ€œ.\ncategory: General\ndate: 2025-08-19\n\n[IMAGE:06_image_1.png]\n\n## Nutze â€FavoritenkanÃ¤leâ€œ in den erweiterten Optionen.\n\nWenn du in den erweiterten Optionen bei â€FavoritenkanÃ¤leâ€œ interessante KanÃ¤le hinterlegst,\nerhÃ¤ltst du folgende Insights:\n\n- [[purple:ğŸ¯ Analyse viraler Shorts]]: virale Elemente dieses Kanals\n- [[purple: ğŸ“Š Leistungskennzahlen prÃ¼fen]]: VerhÃ¤ltnis Aufrufe/Abonnenten und Wachstumsrate\n- [[purple:ğŸ“ˆ Trends erkennen]]: jÃ¼ngste Content-Trends der KonkurrenzkanÃ¤le\n\n---\n\n[IMAGE:06_image_2.png]\n\n## Es ist lÃ¤stig, jedes Mal den Kanalnamen zu tippen.\n\nWenn du viele KonkurrenzkanÃ¤le hast und verschiedene Gruppen betrachten willst,\nnutze eine [[purple:Textdatei]].\n\n1. Liste der interessanten KanÃ¤le in einer Textdatei organisieren\n2. Datei hochladen.\n\nNach dem Upload werden die KanÃ¤le automatisch so eingetragen.\nKlicke jetzt auf Suchen, um die KonkurrenzkanÃ¤le zu analysieren! \n[IMAGE:06_image_3.png]\n",
