  "page1_article7_de": "title: Hinweis zur Verarbeitung Ihres API-SchlÃ¼ssels\nexcerpt: Hinweis zur Sicherheit des API-SchlÃ¼ssels\n\ncategory: General\ndate: 2025-08-19\n\n##Hinweis zur Sicherheit des API-SchlÃ¼ssels\nWir informieren Ã¼ber die Sicherheitsrichtlinie unseres Dienstes.\n\n##ğŸ”’ SicherheitsgrundsÃ¤tze unseres Dienstes\n\n[[purple: Grundsatz der Nichtspeicherung von API-SchlÃ¼sseln]]\n* Ihr API-SchlÃ¼ssel wird weder an unsere Server Ã¼bertragen noch dort gespeichert.\n* Der API-SchlÃ¼ssel wird nur vorÃ¼bergehend im Browserspeicher verwendet und beim Aktualisieren der Seite oder SchlieÃŸen des Tabs gelÃ¶scht.\n* Da es keine Registrierung/Anmeldung gibt, erfassen oder speichern wir auf unseren Servern keine personenbezogenen Identifikationsdaten.\n\n[[purple: Kein serverseitiges Speichern & Hinweis zur Browser-Speicherung]]\n* Wir verwenden keine serverseitigen Datenbanken/Sitzungen/Server-Caches.\n* Zur Verbesserung der Nutzungskomforts werden nur nicht sensible Informationen (z. B. Spracheinstellungen, Ansichtsstatus etc.) im lokalen Speicher des Browsers abgelegt und bleiben erhalten, bis sie vom Browser gelÃ¶scht werden.\n* Sensible Informationen wie API-SchlÃ¼ssel werden nicht im lokalen/Session-Speicher oder in Cookies gespeichert\n\n[[purple: ğŸ’¡ Hinweis zur Browser-AutoausfÃ¼llung]]\nIn einigen FÃ¤llen kann der Eindruck entstehen, dass ein API-SchlÃ¼ssel automatisch ausgefÃ¼llt oder gespeichert wurde; dies kann an den AutoausfÃ¼llen-/Passwortmanager-Einstellungen Ihres Browsers liegen.\n\n[[purple: So beheben Sie es ]]\n1. In den Browsereinstellungen AutoausfÃ¼llen/Speichern deaktivieren\n2. Browserspeicher (localStorage/Cache/Cookies) lÃ¶schen\n3. Inkognito-/Privatmodus verwenden\n\nWir bemÃ¼hen uns, Ihre Informationen durch geeignete SicherheitsmaÃŸnahmen zu schÃ¼tzen.  \nAPI-SchlÃ¼ssel werden ausschlieÃŸlich zum Bearbeiten von Anfragen verwendet und werden grundsÃ¤tzlich nicht fÃ¼r andere Zwecke genutzt.\n",
  "page1_article7_en": "title: Notice on Processing of Your API Key\nexcerpt: Notice Regarding API Key Security\ncategory: General\ndate: 2025-08-19\n\n##ğŸ”’ Our Serviceâ€™s Security Principles\n\n[[purple: API Key Non-Storage Principle]]\n* Your API key is neither transmitted to nor stored on our servers.\n* The API key is used only temporarily in browser memory and is deleted upon page refresh or tab closure.\n* Because there is no sign-up/login, we do not collect or retain personally identifying information on our servers.\n\n[[purple: No Server-Side Storage & Browser Storage Notice]]\n* We do not use server-side databases/sessions/server caches.\n* Only non-sensitive information for service convenience (e.g., language settings, view state) is stored in the browserâ€™s local storage and remains until cleared by the browser.\n* Sensitive information such as API keys is not stored in local/session storage or cookies\n\n[[purple: ğŸ’¡ Browser Auto-fill Notice]]\nIn some cases, an API key may appear to be auto-filled or seem saved; this may be due to the auto-fill/password manager settings of the userâ€™s browser.\n\n[[purple: How to Resolve ]]\n1. Disable auto-fill/save features in your browser settings\n2. Clear browser storage (localStorage/cache/cookies)\n3. Use Incognito/Private Browsing mode\n\nWe strive to protect your information by implementing appropriate security measures.  \nAPI keys are used solely for the purpose of processing requests, and as a matter of principle are not used for any other purpose.\n",
  "page1_article7_es": "title: Aviso sobre el tratamiento de su clave API\nexcerpt: Aviso sobre la seguridad de la clave API\ncategory: General\ndate: 2025-08-19\n\n##ğŸ”’ Principios de seguridad de nuestro servicio\n\n[[purple: Principio de no almacenamiento de claves API]]\n* Su clave API no se transmite ni se almacena en nuestros servidores.\n* La clave API se utiliza Ãºnicamente de forma temporal en la memoria del navegador y se elimina al actualizar la pÃ¡gina o cerrar la pestaÃ±a.\n* Al no haber registro/inicio de sesiÃ³n, no recopilamos ni conservamos informaciÃ³n de identificaciÃ³n personal en nuestros servidores.\n\n[[purple: Sin almacenamiento del lado del servidor & aviso sobre almacenamiento del navegador]]\n* No utilizamos bases de datos/sesiones/cachÃ© del lado del servidor.\n* Solo se almacena en el almacenamiento local del navegador informaciÃ³n no sensible para la comodidad del servicio (p. ej., configuraciÃ³n de idioma, estado de vista, etc.), y permanece hasta que el navegador la elimine.\n* La informaciÃ³n sensible como las claves API no se guarda en el almacenamiento local/de sesiÃ³n ni en cookies\n\n[[purple: ğŸ’¡ Aviso sobre el autocompletado del navegador]]\nEn algunos casos, puede parecer que una clave API se autocompleta o queda guardada; esto puede deberse a la configuraciÃ³n de autocompletado/gestor de contraseÃ±as de su navegador.\n\n[[purple: CÃ³mo solucionarlo ]]\n1. Desactive en la configuraciÃ³n del navegador las funciones de autocompletar/guardar\n2. Limpie el almacenamiento del navegador (localStorage/cachÃ©/cookies)\n3. Use el modo incÃ³gnito/navegaciÃ³n privada\n\nNos esforzamos por proteger su informaciÃ³n implementando medidas de seguridad adecuadas.  \nLas claves API se utilizan Ãºnicamente para procesar solicitudes y, por principio, no se emplean para ningÃºn otro propÃ³sito.\n",
  "page1_article7_fr": "title: Avis concernant le traitement de votre clÃ© API\nexcerpt: Avis concernant la sÃ©curitÃ© de la clÃ© API\ncategory: General\ndate: 2025-08-19\n\n##ğŸ”’ Principes de sÃ©curitÃ© de notre service\n\n[[purple: Principe de non-stockage de la clÃ© API]]\n* Votre clÃ© API nâ€™est ni transmise ni stockÃ©e sur nos serveurs.\n* La clÃ© API nâ€™est utilisÃ©e que temporairement en mÃ©moire du navigateur et est supprimÃ©e lors de lâ€™actualisation de la page ou de la fermeture de lâ€™onglet.\n* En lâ€™absence dâ€™inscription/connexion, nous ne collectons ni ne conservons dâ€™informations dâ€™identification personnelle sur nos serveurs.\n\n[[purple: Absence de stockage cÃ´tÃ© serveur & informations sur le stockage du navigateur]]\n* Nous nâ€™utilisons pas de bases de donnÃ©es/sessions/caches cÃ´tÃ© serveur.\n* Seules des informations non sensibles destinÃ©es au confort dâ€™utilisation (p. ex. rÃ©glages de langue, Ã©tat dâ€™affichage, etc.) sont enregistrÃ©es dans le stockage local du navigateur et y demeurent jusquâ€™Ã  leur suppression par le navigateur.\n* Les informations sensibles telles que les clÃ©s API ne sont pas enregistrÃ©es dans le stockage local/session ni dans les cookies\n\n[[purple: ğŸ’¡ Informations sur lâ€™auto-remplissage du navigateur ]]\nIl peut arriver que la clÃ© API semble Ãªtre auto-remplie ou enregistrÃ©e ; cela peut provenir des paramÃ¨tres dâ€™auto-remplissage/gestionnaire de mots de passe de votre navigateur.\n\n[[purple: Solutions ]]\n1. DÃ©sactiver les fonctions dâ€™auto-remplissage/enregistrement dans les paramÃ¨tres du navigateur\n2. Nettoyer le stockage du navigateur (localStorage/cache/cookies)\n3. Utiliser le mode navigation privÃ©e (mode confidentiel)\n\nNous mettons en Å“uvre des mesures de sÃ©curitÃ© appropriÃ©es afin de protÃ©ger vos informations.  \nLes clÃ©s API sont utilisÃ©es uniquement aux fins de traitement des requÃªtes et, par principe, ne sont pas utilisÃ©es Ã  dâ€™autres fins.\n",
