  "page1_article7_nl": "title: Kennisgeving over de verwerking van uw API-sleutel\nexcerpt: Kennisgeving over de beveiliging van de API-sleutel\ncategory: General\ndate: 2025-08-19\n\n##ğŸ”’ Beveiligingsprincipes van onze dienst\n\n[[purple: Principe van niet-opslag van API-sleutels]]\n* Uw API-sleutel wordt niet naar onze servers verzonden en niet daarop opgeslagen.\n* De API-sleutel wordt uitsluitend tijdelijk in het geheugen van de browser gebruikt en wordt verwijderd bij het verversen van de pagina of het sluiten van het tabblad.\n* Doordat er geen registratie/inloggen is, verzamelen of bewaren wij geen persoonlijk identificeerbare informatie op onze servers.\n\n[[purple: Geen server-side opslag & toelichting over browseropslag]]\n* Wij gebruiken geen server-side databases/sessies/servercaches.\n* Alleen niet-gevoelige informatie voor gebruiksgemak (bijv. taalinstelling, weergavestatus enz.) wordt in de lokale opslag van de browser bewaard en blijft daar totdat de browser deze verwijdert.\n* Gevoelige informatie zoals API-sleutels wordt niet opgeslagen in local/session storage of in cookies\n\n[[purple: ğŸ’¡ Toelichting over automatisch aanvullen in de browser]]\nHet kan voorkomen dat een API-sleutel automatisch ingevuld of opgeslagen lijkt; dit kan worden veroorzaakt door de instellingen voor automatisch aanvullen/wachtwoordbeheerder van uw browser.\n\n[[purple: Oplossingen ]]\n1. Schakel in de browserinstellingen de functies voor automatisch aanvullen/opslag uit\n2. Leeg de browseropslag (localStorage/cache/cookies)\n3. Gebruik de incognitomodus (privÃ©navigatie)\n\nWij zetten passende beveiligingsmaatregelen in om uw informatie te beschermen.  \nAPI-sleutels worden uitsluitend gebruikt voor het verwerken van verzoeken en worden in principe niet voor andere doeleinden gebruikt.\n",
